CREATE TABLE `t_sys_role_user` (
  `ID` int NOT NULL AUTO_INCREMENT COMMENT 'UUID ',
  `ROLE_ID` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '角色ID ',
