  `SYSTEM_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`SYSTEM_USER_ID`),
  KEY `I_SYSTEM_ID` (`SYSTEM_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

