/*Table structure for table `tf_bug` */

DROP TABLE IF EXISTS `tf_bug`;


CREATE TABLE `tf_bug` (
  `BUG_ID` VARCHAR(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '缺陷Id',
  `BUG_NAME` VARCHAR(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '缺陷名称',
  `SYSTEM_ID` VARCHAR(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '测试系统ID',
  `BUG_STATE` VARCHAR(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '缺陷状态',
  `USECASE_ID` VARCHAR(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '关联的用例Id',
  `BUG_SOURCE` VARCHAR(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '缺陷来源',
  `PRORITY` VARCHAR(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '优先级',
  `BUG_DESCRIPITION` VARCHAR(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '缺陷描述',
  `BUG_SEVERITY_LEVEL` INT DEFAULT NULL COMMENT '缺陷严重级别',
  `CLOSE_REASON` VARCHAR(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '缺陷关闭原因',
  `SUBMITTER_ID` VARCHAR(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '提交人Id',
  `DEVELOPER_ID` VARCHAR(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '开发责任人Id',
  `DEV_LEADER_ID` VARCHAR(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '开发组长Id',
  `CHECKER_ID` VARCHAR(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '验证人Id',
  `BUG_TYPE` VARCHAR(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '缺陷类型',
  `DIRECTORY_ID` VARCHAR(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '执行库目录Id',
  `COMMIT_TIME` DATETIME DEFAULT NULL COMMENT '提交时间',
  `CONFIRMED_TIME` DATETIME DEFAULT NULL COMMENT '确认时间',
  `ASSIGNED_TIME` DATETIME DEFAULT NULL COMMENT '分配时间',
  `RESOLVED_TIME` DATETIME DEFAULT NULL COMMENT '解决时间',
  `WAITCHECK_TIME` DATETIME DEFAULT NULL COMMENT '待验证时间',
  `CLOSE_TIME` DATETIME DEFAULT NULL COMMENT '关闭时间',
  `SOLVE_VOLUME` INT DEFAULT '0' COMMENT '解决次数',
  `SUBMITTED_VOLUME` INT DEFAULT '1' COMMENT '提交次数',
  `BUG_WORKFLOW_ID` INT DEFAULT NULL COMMENT '缺陷流程模板',
  PRIMARY KEY (`BUG_ID`),
  KEY `I_SYSTEM_ID` (`SYSTEM_ID`),
  KEY `I_BUG_STATE` (`BUG_STATE`),
  KEY `I_USECASE_ID` (`USECASE_ID`),
  KEY `I_DIRECTORY_ID` (`DIRECTORY_ID`),
  KEY `I_SUBMITTER_ID` (`SUBMITTER_ID`),
  KEY `I_DEVELOPER_ID` (`DEVELOPER_ID`),
  KEY `I_COMMIT_TIME` (`COMMIT_TIME`)
) ENGINE=INNODB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

/*Data for the table `tf_bug` */

